close all hidden
clearvars
%%
%[text] ## Load all Segmentation metadata
%[text] The slicer Segmentation table contains the names of the segmentations, so its good to load all the names to ensure the data formats match. 
paths.folder = fullfile(matlabdrive,"ANAT6205_Dropbox","Femurs"); % note the use of a wild card in the file name
paths.fileWC = '*.seg.nrrd'; % wild card file name to load just segmentation files
segT = mmGetAllSlicerSegTables(fullfile(paths.folder, paths.fileWC)) %[output:12ed738d] %[output:836ce2b9]
%%
%[text] #### Review FAILED segmentation metadata
t = mmGetAllSlicerSegTables(fullfile(paths.folder, segT.Properties.UserData.contents(7).name)) %[output:7b810e6f]
%%
%[text] #### Review last name and segment counts in table
groupsummary(segT,"LastName") %[output:6d96a79c]
groupsummary(segT,"SegName") %[output:7848bcb5] %[output:6b8a5be4]
%%
contents = segT.Properties.UserData.contents(segT.Properties.UserData.si); % use only successful contents
RP  = getFemurLength(contents) %[output:9f57ece5] %[output:4def345a] %[output:10307913] %[output:0b40d61d] %[output:681aaa42] %[output:000846fe] %[output:23de4946] %[output:6269d960] %[output:20f3a93c] %[output:11933c37]

function RP = getFemurLength(contents)

VN = ["LastName","SegName","Length","Volume","Extent"];
num = numel(contents);

RP = table(strings(num,1), strings(num,1), zeros(num,1), zeros(num, 1), zeros(num,3), VariableNames=VN);


figure;
tiledlayout("flow", "TileSpacing","none","Padding","tight"); % create a tiled layout for plotting
hwb = waitbar(0,'Calculating...');
for n=1:num

    filepath = fullfile(contents(n).folder,contents(n).name); % construct file path
    lastName = extractBefore(contents(n).name,("_"|" "));
    mv = medicalVolume(filepath); % load segmentation volum
    st = mmGetSlicerSegTable(filepath);  % get slicer segmentation
    
    seg = mmGetMedicalVolumeSegment(mv,st, segName="right femur"); % select left femur
    seg.fv = mmGetSurface(seg.mask,"affTrfm",seg.tform.A); % create surface in mm space without plotting (saves time)
    seg.fv.vertices = seg.fv.vertices - mean(seg.fv.vertices); % center to 0,0,0
    seg.fv.vertices = mmAlignSurface2Axes(seg.fv.vertices); % align to xy plane
    seg.fv.vertices = mmRotateSurfaceVertices(seg.fv.vertices,'y',-90); % rotate back to align with zplane
    seg.extent = range(seg.fv.vertices); % mm
    seg.length = max(seg.extent); % mm
   
    rp = table(string(lastName), seg.segName, seg.length, seg.volume * prod(0.1 * seg.spacing), seg.extent,VariableNames=VN);
    RP(n,:)  = rp; % Store last name and femur length in the results table
    
    
    nexttile
    la = st.SegName == "left femur";
    mmPlotSurface(seg.fv,st.Color(la,:),0.5);
    mmSetSurfacePlotProps;
    axis off
    
    % drawcuboid('Position',[min(seg.fv) range(seg.fv)],'FaceAlpha',0.1)
    title(lastName)
    waitbar(n/num,hwb,lastName)

end
delete(hwb)
end
